// src/App.js
import React, { useState } from 'react';
import axios from 'axios';

function App() {
  // State variables
  const [departure, setDeparture] = useState('');
  const [destination, setDestination] = useState('');
  const [date, setDate] = useState('');
  const [time, setTime] = useState('');
  const [cabinClass, setCabinClass] = useState('Economy');
  const [airline, setAirline] = useState('');
  const [userWeight, setUserWeight] = useState(0.5);
  const [enterpriseWeight, setEnterpriseWeight] = useState(0.5);
  const [inventoryWeight, setInventoryWeight] = useState(0.5);
  const [flights, setFlights] = useState([]);

  // Function to handle form submission
  const handleSearch = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://localhost:5000/api/rank_flights', {
        departure,
        destination,
        date,
        time,
        cabinClass,
        airline,
        weights: {
          user: userWeight,
          enterprise: enterpriseWeight,
          inventory: inventoryWeight,
        },
      });
      setFlights(response.data);
    } catch (error) {
      console.error('Error fetching flight data:', error);
    }
  };

  return (
    <div className="App">
      <h1>Flight Ranking System</h1>
      <form onSubmit={handleSearch}>
        <div>
          <label>Departure City:</label>
          <input type="text" value={departure} onChange={(e) => setDeparture(e.target.value)} required />
        </div>
        <div>
          <label>Destination City:</label>
          <input type="text" value={destination} onChange={(e) => setDestination(e.target.value)} required />
        </div>
        <div>
          <label>Date:</label>
          <input type="date" value={date} onChange={(e) => setDate(e.target.value)} required />
        </div>
        <div>
          <label>Time:</label>
          <input type="time" value={time} onChange={(e) => setTime(e.target.value)} required />
        </div>
        <div>
          <label>Cabin Class:</label>
          <select value={cabinClass} onChange={(e) => setCabinClass(e.target.value)}>
            <option value="Economy">Economy</option>
            <option value="Business">Business</option>
            <option value="First Class">First Class</option>
          </select>
        </div>
        <div>
          <label>Preferred Airline:</label>
          <input type="text" value={airline} onChange={(e) => setAirline(e.target.value)} />
        </div>
        <h2>Adjust Weights</h2>
        <div>
          <label>User Preference Weight:</label>
          <input
            type="range"
            min="0"
            max="1"
            step="0.1"
            value={userWeight}
            onChange={(e) => setUserWeight(parseFloat(e.target.value))}
          />
          <span>{userWeight}</span>
        </div>
        <div>
          <label>Enterprise Preference Weight:</label>
          <input
            type="range"
            min="0"
            max="1"
            step="0.1"
            value={enterpriseWeight}
            onChange={(e) => setEnterpriseWeight(parseFloat(e.target.value))}
          />
          <span>{enterpriseWeight}</span>
        </div>
        <div>
          <label>Inventory Weight:</label>
          <input
            type="range"
            min="0"
            max="1"
            step="0.1"
            value={inventoryWeight}
            onChange={(e) => setInventoryWeight(parseFloat(e.target.value))}
          />
          <span>{inventoryWeight}</span>
        </div>
        <button type="submit">Search Flights</button>
      </form>

      <h2>Recommended Flights</h2>
      {flights.length > 0 ? (
        <ul>
          {flights.map((flight, index) => (
            <li key={index}>
              <p>Flight {index + 1}</p>
              <p>Departure: {flight.departure}</p>
              <p>Arrival: {flight.arrival}</p>
              <p>Airline: {flight.airline}</p>
              <p>Price: {flight.price}</p>
            </li>
          ))}
        </ul>
      ) : (
        <p>No flights found. Adjust your preferences and try again.</p>
      )}
    </div>
  );
}

export default App;
